BESCHREIBUNG:
Placée sous la supervision directe du Directeur opérationnel, cette position inclut (i) la participation à la définition de la stratégie de développement et sa mise en uvre (plan daction), (ii) lidentification dopportunités commerciales adaptées, tenant compte dune saine gestion des risques, (iii) la prise en charge de lexécution des contrats commerciaux en lien direct avec les contreparties locales ainsi que (iv) lémission de rapports analytiques quotidiens à destination du management dEuronova et dautres contreparties identifiées.

Cette position requiert les qualités et compétences particulières suivantes : 
expérience réussie en matière dacquisition de clientèle, de gestion de clients-clés (groupes pétroliers teneurs de marché et leaders régionaux, gestionnaires de terminaux mer/rivières) dans les marchés concernés de lEurope du Sud-est ;
capacités de gestion opérationnelle, de suivi et de surveillance dactivités de transport maritime incluant notamment le service par barges sur le Danube ;
serbe et croate parlés et écrits, excellentes connaissances danglais ;
formation universitaire en économie ou finance.

Profil: la personne doit:
avoir obtenu un bachelor et une maîtrise en droit délivrés par une université suisse;
maîtriser parfaitement la langue albanaise écrite et parlée (possiblement être de langue maternelle) et avoir une excellente maîtrise du français et de l'anglais;
avoir une bonne connaissance du droit suisse des affaires (le/la candidate doit être à jour avec les changements législatifs en droit bancaire et réglementaire, droit fiscal ainsi qu'en matière de blanchiment d'argent). Une expérience de travail dans le domaine bancaire et des fonds de placements est indispensable;
doit avoir une maîtrise de la législation de la République de l'Albanie et du Kosovo. Une expérience professionnelle dans un de ces pays est préférable;
être disposé(e) à voyager dans ces pays si besoin.

Tâches: la personne doit:
conseiller juridiquement et fiscalement tout investisseur albanais désireux d'investir ses avoirs en Suisse, notamment dans des fonds de placement et des produits financiers en tous genres;
représenter les clients albanophones envers les banques de la place, les gérants de fortune, les directions de fonds, les notaires, la FINMA et devant tout autre autorité publique;
être en contact permanent avec les clients albanophones, anticiper, comprendre, négocier et répondre à leurs besoins;
rédiger des contrats, préparer les actes constitutifs à la création de sociétés, préparer des dossiers due diligence et know your customer et tout autre acte juridique selon les circonstances en albanais, français et anglais.
être en mesure de négocier avec les autorités albanaises et kosovares;
être à jour avec tous les changements législatifs et réglementaires pertinentes en Suisse, UE, Albanie et Kosovo; 
être en mesure de faire le suivi des dossiers, fixer les priorités, gérer la correspondance, le classement, ainsi que l'archivage

Core skills : 

Excellent legal training ( Bachelor and Masters / LLM) ;

Specialisation in arbitration, ideally through years of work experience ; 

Knowledge of arbitral institutions (LCIA, LMAA, ICCC, Swiss and Swedish rules of arbitrations) ; 

Experience in oil and Gas in the CIS region. 

2 - 3 years of experience in a similar role ; 

Professional proficiency in English ; 

Russian speaking (and writing) ; 

Preferably admitted to practice law ; 

Good communication skills, capable of coping with pressure ; 

Available August - September ;

