BESCHREIBUNG:
The Position
The Project Coordinator is responsible for assisting the Heads of the Expansion team by bringing them the daily support needed for their lobbying and promotion activities to further expand the TIR System globally, with a special focus on the Middle East and Africa. 

Main Objectives and Responsibilities
Coordinate, supervise and contribute to key support activities such as the preparation of training and promotional material, the scoping and delivery of studies, the organisation of field visits and other events, etc.; 
Accompany the Heads of the Expansion team in field visits and other events undertaken to further develop the attractiveness of the TIR system and other IRU businesses that can stem from that, i.e. IRU Academy, etc.; 
Supervise activities within the Expansion team, but also across teams (Finance, Communications, etc.) and report progress (e.g. heads of the Expansion team, TIR Management, Portfolio Management) as needed; 
Be involved in the IRU projects that matter to the expansion of the TIR system, such as the eTIR, Intermodal TIR and TIR Authorised Consignor/ee projects, to be able to represent the interests of these projects in the field; 
Undertake any other tasks assigned by the management. 

Personal Behaviors to Display
Interpersonal skills necessary for team management and for working in matrix operations (e.g. teamwork, communication, ability to build strong personal relationships and engage others); 
Self-organized, proactive, with a strong interest in project management; 
Willing to travel to Middle East and Africa frequently.

Languages requested: Arabic, English, French and if possible Hebrew
